import '../../css/additional.css'

const InteriorItem = ({ interior, setInterior, selected, disabled }) => {

    const imgUrl = "http://localhost:3000/" + interior.thumbnailUrl + ".webp";



    return (
        <div onClick={() => setInterior(interior)} className="mb-3 mx-3 d-inline-block" disabled>
            <div>
                <div><button className="color-button" style={{ "background": `url(${imgUrl})`, "backgroundSize": "60px 60px" }} disabled={disabled}></button></div>
                <input className="form-check-input" type="radio" checked={selected} readOnly={true} disabled={disabled} />
            </div>
        </div>

    )

}

export default InteriorItem;
